import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Navbar from "./components/Navbar";
import LandingPage from "./pages/LandingPage";
import LoginPage from "./pages/LoginPage";
import SignupPage from "./pages/SignupPage";
import StudentDashboard from "./pages/StudentDashboard";
import PrivateRoute from "./components/PrivateRoute";
import PlacementPrep from "./pages/PlacementPrep";
import CoreSubjects from "./pages/CoreSubjects";


function App() {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<LandingPage />} />
        <Route path="/login" element={<LoginPage />} />
        <Route path="/signup" element={<SignupPage />} />
        <Route path="/student/dashboard" element={<StudentDashboard />} />
        <Route
          path="/student/dashboard"
          element={
            <PrivateRoute>
              <StudentDashboard />
            </PrivateRoute>
          }
        />

        <Route path="/placement-prep" element={<PlacementPrep />} />
        <Route
          path="/placement-prep/core-subjects"
          element={<div>Core Subjects Page</div>}
        />
        <Route
          path="/placement-prep/aptitude"
          element={<div>Aptitude Page</div>}
        />
        <Route
          path="/placement-prep/resume-analyzer"
          element={<div>Resume Analyzer Page</div>}
        />

         <Route path="/placement-prep/core-subjects" element={<CoreSubjects />} />

        // Later you can add nested routes for each topic
        <Route path="/placement-prep/core-subjects/dbms" element={<div>DBMS Notes & Practice</div>} />
        <Route path="/placement-prep/core-subjects/os" element={<div>OS Notes & Practice</div>} />
        <Route path="/placement-prep/core-subjects/cn" element={<div>CN Notes & Practice</div>} />
        <Route path="/placement-prep/core-subjects/dsa" element={<div>DSA Notes & Practice</div>} />

      </Routes>
    </Router>
  );
}

export default App;
